    public boolean hasGroupsSizeX(int[] deck) {
        if (deck == null || deck.length == 0 || deck.length == 1) {
            return false;
        }

        ArrayList<Integer> al = new ArrayList<>();
        Arrays.sort(deck);

        int temp = deck[0];
        int count = 1;
        for (int i = 1; i < deck.length; i++) {
            if (deck[i] == temp) {
                count++;
            } else {
                al.add(count);
                temp = deck[i];
                count = 1;
            }
        }
        al.add(count);

        int min = al.get(0);
        for (int a : al) {
            if (a < min) min = a;
        }
        if (min == 1) return false;
        //   System.out.println(al.toString());
        HashSet<Integer> hs = new HashSet<>();
        hs.add(min);
        for (int i = 2; i <= Math.floor(Math.sqrt(min)); i++) {
            if (min % i == 0) {
                hs.add(i);
                hs.add(min / i);
            }
        }
        // System.out.println(hs.toString());
        for (int a : hs) {
            boolean isok = true;
            for (int b : al) {
                if (b % a != 0) {
                    isok = false;
                    break;
                }
            }
            if (isok) return isok;
        }
        return false;
    }

